    var xinjiang = dataModel.getDataByTag('mengxj');
    var fasanxian = dataModel.getDataByTag('fasanxian');
     quanguo.s('opacity', 1);
     xinjiang.s('opacity', 0);
     fasanxian.s('2d.visible', false);
     ht.Default.startAnim({
                                duration: 300,
                                finishFunc: function() {
                                    quanguo.s('opacity', 0);
                                },
                                action: (v, t) => {
                                    quanguo.s('opacity',1-v);
                                }
                            });
     ht.Default.startAnim({
                                duration: 300,
                                finishFunc: function() {
                                    xinjiang.s('opacity', 1);
                                },
                                action: (v, t) => {
                                    xinjiang.s('opacity',v);
                                }
                            });
}

